import React, { Component } from 'react';
import './index.css';

class Filter extends Component {
    render() {
        return (
            <div id="filter">
                <button onClick={() => this.props.getFilter(0)} className="text">
                    All
                </button>
                <button onClick={() => this.props.getFilter(1)} className="text">
                    Reserved
                </button>
            </div>
        );
    };
};

export default Filter;
